import { useState } from 'react';
import createHook from '../component/index-predicate';

const useSpinner = createHook(useState, 5);

const Logo = ({ v }) => {
  const [t] = useSpinner();
  return (
    <>
      <img src="/static/logo.svg" />
      <style jsx>{`
        img {
          animation: App-logo-spin infinite ${t}s linear;
          height: 25vmin;
          pointer-events: none;
        }

        @keyframes App-logo-spin {
          from {
            transform: rotate(0deg);
          }
          to {
            transform: rotate(360deg);
          }
        }
      `}</style>
    </>
  );
};

export default () => (
  <>
    <table>
      <tbody>
        <tr>
          {Array.from({ length: 10 }).map((_, i) => (
            <td key={i}>
              <Logo />
            </td>
          ))}
        </tr>
      </tbody>
    </table>
  </>
);
